import React, { Component } from 'react'
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'

import './Topbar.css'

import { Link } from 'react-router-dom'



class Topbar extends Component {

    constructor() {
        super()
    }



    render() {

        return (
            <Navbar bg="dark" variant="dark" expand="md">
                <Navbar.Brand as="div"><Link to="/">theWatchmen</Link></Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="ml-auto">
                        <Nav.Link as="div"><Link to="/">Iniciar sesi√≥n</Link></Nav.Link>
                        <Nav.Link as="div"><Link to="/">Registro</Link></Nav.Link>
                    </Nav>
                    <Navbar.Text className="ml-auto"> Hola, {this.props.loggedInUser ? this.props.loggedInUser.username : 'invitad@'}</Navbar.Text>
                </Navbar.Collapse>

            </Navbar>
        )
    }

}

export default Topbar
